import React, { useState, useEffect } from 'react';
import { adminAPI } from '../../utils/api';
import AdminUpload from '../AdminUpload/AdminUpload';
import SessionUpload from '../SessionUpload/SessionUpload';
import AdminReports from '../AdminReports/AdminReports';
import './AdminDashboard.css';

const AdminDashboard = ({ user, onLogout }) => {
  const [activeTab, setActiveTab] = useState('sessions');
  const [sessions, setSessions] = useState([]);
  const [jobs, setJobs] = useState([]);
  const [resumes, setResumes] = useState([]);
  const [menuOpen, setMenuOpen] = useState(false);
  const [newJob, setNewJob] = useState({
    title: '',
    company: '',
    location: '',
    experience: '',
    skills: '',
    description: ''
  });
  const [newSession, setNewSession] = useState({
    sessionId: '',
    title: '',
    speaker: '',
    time: '',
    room: '',
    track: ''
  });
  const [loading, setLoading] = useState(false);
  const [message, setMessage] = useState('');
  const [error, setError] = useState('');

  useEffect(() => {
    if (activeTab === 'sessions') {
      loadSessions();
    } else if (activeTab === 'jobs') {
      loadJobs();
      loadResumes();
    }
  }, [activeTab]);

  const loadSessions = async () => {
    try {
      const response = await adminAPI.getSessions();
      setSessions(response.data);
    } catch (error) {
      setError('Failed to load sessions');
    }
  };

  const loadJobs = async () => {
    try {
      // Simulate API call
      setJobs([
        { id: 1, title: 'AWS Cloud Engineer', company: 'TechCorp', location: 'Vadodara', experience: '2-4 years' },
        { id: 2, title: 'DevOps Engineer', company: 'InnovateTech', location: 'Remote', experience: '3-5 years' }
      ]);
    } catch (error) {
      setError('Failed to load jobs');
    }
  };

  const loadResumes = async () => {
    try {
      // Simulate API call
      setResumes([
        { id: 1, name: 'John Doe', email: 'john@example.com', phone: '9876543210', experience: '2-4 years', skills: 'AWS, React, Node.js' },
        { id: 2, name: 'Jane Smith', email: 'jane@example.com', phone: '9876543211', experience: '3-5 years', skills: 'DevOps, Docker, Kubernetes' }
      ]);
    } catch (error) {
      setError('Failed to load resumes');
    }
  };

  const handleInputChange = (e) => {
    setNewSession({
      ...newSession,
      [e.target.name]: e.target.value
    });
  };

  const handleJobInputChange = (e) => {
    setNewJob({
      ...newJob,
      [e.target.name]: e.target.value
    });
  };

  const handleCreateSession = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError('');
    setMessage('');

    try {
      await adminAPI.createSession(newSession);
      setMessage('Session created successfully');
      setNewSession({
        sessionId: '',
        title: '',
        speaker: '',
        time: '',
        room: '',
        track: ''
      });
      loadSessions();
    } catch (error) {
      setError(error.response?.data?.message || 'Failed to create session');
    } finally {
      setLoading(false);
    }
  };

  const handleCreateJob = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError('');
    setMessage('');

    try {
      // Simulate API call
      await new Promise(resolve => setTimeout(resolve, 1000));
      setMessage('Job created successfully');
      setNewJob({
        title: '',
        company: '',
        location: '',
        experience: '',
        skills: '',
        description: ''
      });
      loadJobs();
    } catch (error) {
      setError('Failed to create job');
    } finally {
      setLoading(false);
    }
  };

  const handleJobCSVUpload = async (e) => {
    const file = e.target.files[0];
    if (!file) return;

    setLoading(true);
    try {
      // Simulate CSV upload
      await new Promise(resolve => setTimeout(resolve, 2000));
      setMessage('Jobs uploaded successfully from CSV');
      loadJobs();
    } catch (error) {
      setError('Failed to upload jobs CSV');
    } finally {
      setLoading(false);
    }
  };

  const exportResumes = () => {
    const csvContent = 'Name,Email,Phone,Experience,Skills\n' +
      resumes.map(r => `${r.name},${r.email},${r.phone},${r.experience},"${r.skills}"`).join('\n');

    const blob = new Blob([csvContent], { type: 'text/csv' });
    const url = window.URL.createObjectURL(blob);
    const a = document.createElement('a');
    a.href = url;
    a.download = 'resumes-export.csv';
    a.click();
    window.URL.revokeObjectURL(url);
  };

  const exportJobs = () => {
    const csvContent = 'Title,Company,Location,Experience\n' +
      jobs.map(j => `${j.title},${j.company},${j.location},${j.experience}`).join('\n');

    const blob = new Blob([csvContent], { type: 'text/csv' });
    const url = window.URL.createObjectURL(blob);
    const a = document.createElement('a');
    a.href = url;
    a.download = 'jobs-export.csv';
    a.click();
    window.URL.revokeObjectURL(url);
  };

  const renderTabContent = () => {
    switch (activeTab) {
      case 'sessions':
        return (
          <div className="sessions-tab">
            <div className="create-session-form">
              <h3>Create New Session</h3>
              <form onSubmit={handleCreateSession}>
                <div className="form-row">
                  <div className="form-group">
                    <label className="form-label">Session ID</label>
                    <input
                      type="text"
                      name="sessionId"
                      value={newSession.sessionId}
                      onChange={handleInputChange}
                      className="form-input"
                      required
                    />
                  </div>
                  <div className="form-group">
                    <label className="form-label">Title</label>
                    <input
                      type="text"
                      name="title"
                      value={newSession.title}
                      onChange={handleInputChange}
                      className="form-input"
                      required
                    />
                  </div>
                </div>

                <div className="form-row">
                  <div className="form-group">
                    <label className="form-label">Speaker</label>
                    <input
                      type="text"
                      name="speaker"
                      value={newSession.speaker}
                      onChange={handleInputChange}
                      className="form-input"
                      required
                    />
                  </div>
                  <div className="form-group">
                    <label className="form-label">Time</label>
                    <input
                      type="text"
                      name="time"
                      value={newSession.time}
                      onChange={handleInputChange}
                      className="form-input"
                      placeholder="e.g., 10:00 AM - 11:00 AM"
                      required
                    />
                  </div>
                </div>

                <div className="form-row">
                  <div className="form-group">
                    <label className="form-label">Room</label>
                    <input
                      type="text"
                      name="room"
                      value={newSession.room}
                      onChange={handleInputChange}
                      className="form-input"
                      required
                    />
                  </div>
                  <div className="form-group">
                    <label className="form-label">Track</label>
                    <input
                      type="text"
                      name="track"
                      value={newSession.track}
                      onChange={handleInputChange}
                      className="form-input"
                      required
                    />
                  </div>
                </div>

                <button type="submit" className="btn btn-primary" disabled={loading}>
                  {loading ? 'Creating...' : 'Create Session'}
                </button>
              </form>

              {message && <div className="success-message">{message}</div>}
              {error && <div className="error-message">{error}</div>}
            </div>

            <div className="sessions-list">
              <h3>Existing Sessions ({sessions.length})</h3>
              {sessions.length === 0 ? (
                <p>No sessions created yet</p>
              ) : (
                <div className="sessions-grid">
                  {sessions.map((session) => (
                    <div key={session.sessionId} className="session-item">
                      <h4>{session.title}</h4>
                      <p><strong>Speaker:</strong> {session.speaker}</p>
                      <p><strong>Time:</strong> {session.time}</p>
                      <p><strong>Room:</strong> {session.room}</p>
                      <p><strong>Track:</strong> {session.track}</p>
                    </div>
                  ))}
                </div>
              )}
            </div>
          </div>
        );

      case 'upload':
        return (
          <div>
            <AdminUpload />
            <SessionUpload onUploadSuccess={loadSessions} />
          </div>
        );

      case 'reports':
        return <AdminReports />;

      default:
        return null;
    }
  };

  return (
    <div className="admin-dashboard">
      <header className="header">
        <div className="container">
          <div className="header-content">
            <div className="header-brand">
              <h1>AWS UG Vadodara - Admin Panel</h1>
              <p className="subtitle">Community Day Management</p>
            </div>
            <div className="header-right">
              <div className={`header-actions ${menuOpen ? 'open' : ''}`}>
                <button className="btn btn-secondary" onClick={onLogout}>
                  Logout
                </button>
              </div>
              <button className="menu-toggle" onClick={() => setMenuOpen(!menuOpen)}>
                <span></span>
                <span></span>
                <span></span>
              </button>
            </div>
          </div>
        </div>
      </header>

      <main className="container">
        <div className="admin-tabs">
          <button
            className={`tab-btn ${activeTab === 'sessions' ? 'active' : ''}`}
            onClick={() => setActiveTab('sessions')}
          >
            Sessions
          </button>
          <button
            className={`tab-btn ${activeTab === 'upload' ? 'active' : ''}`}
            onClick={() => setActiveTab('upload')}
          >
            Upload Data
          </button>
          <button
            className={`tab-btn ${activeTab === 'reports' ? 'active' : ''}`}
            onClick={() => setActiveTab('reports')}
          >
            Reports
          </button>
        </div>

        <div className="tab-content">
          {renderTabContent()}
        </div>
      </main>

      <footer className="footer">
        <div className="container">
          <div className="footer-content">
            <div className="footer-section">
              <h4>AWS UG Vadodara</h4>
              <p>Admin Panel - Community Day 2025</p>
            </div>
            <div className="footer-section">
              <p>Powered by AWS Community</p>
              <p>Â© 2025 AWS User Group Vadodara</p>
            </div>
          </div>
        </div>
      </footer>
    </div>
  );
};

export default AdminDashboard;
